import React from "react";
import NavBar from "./navbar";
class ProductPage extends React.Component {
  render() {
    return (
      <div>
        <NavBar color="black" active="login" />
        {/* Search */}
        <div>
          <div>
            <span>S</span>
            <input type="text" />
            <button>SEARCH</button>
          </div>
        </div>
      </div>
    );
  }
}

export default ProductPage;
